import React from 'react';
function Header(){
    return(
        <div className="wrapper">
            <div className="container">
                <a href="#" className="header-logo">
                    <img src={process.env.PUBLIC_URL +"/logo.png"} alt="logo">
                    </img>
                    <span>AAPet</span>  
                </a>
                <ul className="navbar">
                    <li><a href="#">Home</a></li>
                    <li><a href="#">Item</a></li>
                    <li><a href="#">Pet</a></li>
                </ul>
            </div>
        </div>
    )
};
export default Header;
